    function timeFormat(time) {
        let res = []
        let [s = 0, m = 0, h = 0] = time.split(':').reverse()

        res.unshift(String(s).padStart(2, '0'))
        res.unshift(String(m % 60).padStart(2, '0'))
        res.unshift(String(h % 60).padStart(2, '0'))

        return res.join(':')
    }


